int longestConsecutive(vector<int> &num) {
    int longest = 0;
    unordered_multimap<int, int> hash;
    int i;

    for (i = 0; i < num.size(); ++i) {
      hash.emplace(num[i], num[i]);
    }

    for (i = 0; i < num.size(); ++i) {
      if (hash.count(num[i]) > 0) {
        longest = max(longest,
            consecutives(hash, num[i], false) + 
                consecutives(hash, num[i] + 1, true));
      }
    }

    return longest;
  }

